import base64
import tempfile
import wave
from speechbrain.inference.VAD import VAD
import librosa
import soundfile as sf
import torchaudio

# Your Base64 string
base64_str = """"""


# 2. Decode the raw Base64 to binary data
audio_buffer = base64.b64decode(base64_str)

original_sample_rate = 48000
SAMPLE_RATE = 16000
filename = "output.wav"
# with tempfile.NamedTemporaryFile(suffix='.wav') as f, wave.open(f.name, 'wb') as wf:
with wave.open(filename, 'wb') as wf:
    wf.setnchannels(1)
    wf.setsampwidth(2)
    wf.setframerate(48000)
    wf.writeframes(audio_buffer)
    if original_sample_rate != SAMPLE_RATE:
        y, old_sr = librosa.load(filename)
        y_resampled = librosa.resample(y, orig_sr=old_sr, target_sr=SAMPLE_RATE)
        sf.write(filename, y_resampled, SAMPLE_RATE)
    
VAD = VAD.from_hparams(
    source="speechbrain/vad-crdnn-libriparty"
)

boundaries = VAD.get_speech_segments(
    filename, 
    apply_energy_VAD=True, 
    # close_th=0.025, 
    # len_th=0.1
)
segments = VAD.get_segments(
    boundaries,
    filename
)
for i, segment in enumerate(segments):
    torchaudio.save(f"segments/output_{i}.wav", segment, SAMPLE_RATE, format='wav')
print(boundaries)
print("\n", segments)
# with open('output.wav', 'wb') as f:
#     f.write(audio_buffer)

print("WAV file created successfully!")